import React from 'react';
import  './card-list.styles.css';
export const CardList = props => {
    console.log(props);
   
    return <div className='card-list'>{props.children}
     {
        props.children.map(monster => (
          <h1 key={monster.id}>{monster.name}</h1>
        ))
      }
    </div>;
}
